const calDays = (date) => {
  const fechaInicio = new Date('2021-07-28').getTime()
  const fechaFin = new Date(date).getTime()
  return Math.trunc((fechaFin - fechaInicio) / (1000 * 60 * 60 * 24))
}

const ConvertDateToString = (date) => {
  const d = new Date(date)
  d.setHours(d.getHours() - 5)
  d.setDate(d.getDate() + 1)

  const mes = new Intl.DateTimeFormat('es-419', { month: 'long' }).format(d)
  const num = new Intl.DateTimeFormat('es-419', { day: '2-digit' }).format(d)
  const dia = new Intl.DateTimeFormat('es-419', { weekday: 'long' }).format(d)
  return `${dia} ${num} de ${mes}`
  /*
    Martes 31 de Agosto
  */
}

